import styled from 'styled-components';

export const StyledPosition = styled.div`
  background-color: transparent;
  border: 1px solid green;
  border-radius: 5px;
  width: 50px;
  height: 150px;
  padding: 15px;
  font-size: 10px;
  display: flex;
  flex-wrap: wrap;
  flex-direction: column;
`;
export const StyledGuitarTabsList = styled.div``;
